//TLE solution
class Solution1 {
public:
    bool check(string aux,vector<int>&def){
        vector<int>freq(58,0);
        for(int i=0;i<aux.length();i++){
            freq[aux[i]-'A']++;
        }
        int i;
        // if(aux=="abbbbbcdd"){    
        //     for(auto x:def){
        //         cout<<x<<" ";
        //     }
        //     cout<<endl;
        //     for(auto x:freq){
        //         cout<<x<<" ";
        //     }
        //     cout<<endl;
        // }
        for(i=0;i<58;i++){
            if(def[i]!=0 && def[i]>freq[i]) break;
        }
        if(i==58) return true;
        return false;
    }

    string minWindow(string s, string t) {
        int n=s.length();
        int m=t.length();
        if(m>n) return "";
        //cout<<n<<" "<<m<<endl;
        vector<int>def(58,0);
        for(int i=0;i<m;i++){
            def[t[i]-'A']++;
            // cout<<t[i]-'A'<<endl;
        }
        // for(auto x:def){
        //     cout<<x<<" ";
        // }
        // cout<<endl;
        int ans=INT_MAX;
        string res="";
        for(int len=m;len<=n;len++){
            for(int start=0;start<=n-len;start++){
                // if(len==9) cout<<s.substr(start,len)<<endl;
                if(check(s.substr(start,len),def)){
                    res=s.substr(start,len);
                    break;
                }
            }
            if(res!="") break;
        }
        return res;
    }
};

class Solution {
public:
    string minWindow(string s, string t) {
        int n=s.length();
        int m=t.length();
        if(m>n) return "";
        string res="";
        int len=INT_MAX;
        unordered_map<char,int>mp;
        for(int i=0;i<m;i++){
            mp[s[i]]++;
        }
        

        return res;   
    }
};

